import api from '../utils/api';
import { response } from 'express';

class Game extends Component {

  state = {
    email : ""
  }
  componentDidMount() {
    api.getUser().then(response => {
      this.setState()
    })
  }
  render () {
    return (
      <>
      <MainNav />
      <GameDetails />
      <Footer />
      </>
    )
  }

}

export default Game;
